import React from 'react'

export default function Introduction() {
    return (
        <div>
            <h1>What is this?</h1>
            <p>
                This cancer classifier uses two sets of data to determine whether
                an individual has cancer or not. More specifically, it uses what 
                is called a support vector machine to make such predictions. A
                support vector machine is trained on a subset of the provided data
                and draws boundaries between the data which separate cancer positive
                and cancer negative individuals.
            </p>
        </div>
    );
}
